import TextField from '@material-ui/core/TextField';
import { createMuiTheme } from '@material-ui/core/styles';

const styleInput = {
    height: '100px',
    width: '25ch'
};
const styleBack = {
    margin: '250px',
    color: '#e1f5fe'
}

const Login = () =>{
    return(
        <div style = {styleBack}>
            <form style={styleInput}>
                <TextField 
                    required
                    class="Input"
                    label="Email"
                    defaultValue="YourEmail@mail.com"
                    variant="outlined"
                    color="primary"
                />
            </form>
        </div>
    )
}

export default Login;
